import React, { useEffect, useRef } from "react";

function SvgComponent(props) {
    const svgRef = useRef(null);

    console.log('=====', props.svgElem)

    useEffect(() => {
        // 创建DocumentFragment，并将svg元素对象添加到其中
        const fragment = document.createDocumentFragment();
        fragment.appendChild(props.svgElem);

        // 将DocumentFragment添加到svgRef.current
        svgRef.current.appendChild(fragment);
    }, [props.svgElem]);


    return (
        <div>
            <svg width="100%" height="100%" ref={svgRef}></svg>
        </div>
    );
}

export default SvgComponent;
